import logo from './logo.svg';
import './App.css';
import Landing from './landing/landing.js'
import { Switch, Link, Route } from 'react-router-dom';

function App() {
  return (
    <div>

    <Switch>
      <Route exact path='/' render={(props) => <Landing {...props}/>} />
    </Switch>

    </div>
  );
}

export default App;
